import React from 'react'
import { Box, TextField, List, ListItem, ListItemText } from '@material-ui/core'

class VinList extends React.Component {
    constructor(props) {
        super(props);
        this.state =  {
            vin: '',
            vin_list: ['lfv','wvw']
        }
      }
    handleVinChange(e) {
        console.log(e)

    }
    render() {
        return (
            <>
                <TextField 
                    id='vin'
                    label='vin'
                    value={this.state.vin}
                    onChange={this.handleVinChange}
                />
                
                <Box>
                    <h3> Vin List</h3>
                    <List>
                    { this.state.vin_list.map( (vin) => 
                        <ListItem key={vin}>
                            <ListTiemText primary={`Vin ${vin}`} />
                        </ListItem>)}

                    </List>
                    
                </Box>
            </>
        )
    }
    

}

export default VinList
